Leilani Dowding (born 30 January 1980)[1] is an English former Page Three girl, glamour model, television celebrity, and Miss Universe contestant.
After her success in beauty pageants, Dowding dropped out of university to pursue a full-time modelling career.[1] Although she had not originally considered topless modelling, she started appearing as a Page Three girl in The Sun newspaper in 1999.[1] Her younger sister Melanie (&quot;Mel&quot;) Dowding also had a brief career as a model, during which the sisters posed topless together. Melanie is working as a promotional model in the motorsport industry.[5]

In 2003 she was rated #89 on the FHM Sexiest Women in World list.[6]

Dowding has been a guest on various British television shows, modelling on the Big Breakfast and This Morning, and appearing on Faking It Celebrity Wrestling and Celebrity Fear Factor.[7] She has also enjoyed a season in pantomime as Tiger Lilly in Peter Pan.[1]

Dowding appeared on a charity Page 3 episode of The Weakest Link where she lost out in the sudden death round to Jakki Degg. Dowding was competing on behalf of the RSPCA and breast cancer charities.[8] She joked &quot;I look forward to using my brain for the first time in three years.&quot;[9]

Dowding has competed in celebrity poker tournaments and done promotional work for Ladbrokes.[1][10][11]

She also appears in the American TV Reality Show Tough Love Miami, in which she deals with her superficiality in order to find a suitable mate.

She has travelled to Bosnia, Kosovo. Iraq and Cyprus on morale-boosting trips for British troops abroad.[1]

She appeared in the December 2011 edition of US Maxim.

Leilani has her own clothing line, the Leiluna Collection.
